// Save encoded data to file in C-style array format
// Parameters:
//   filename: Name of file to create
//   encoded: Pointer to encoded data array
//   encoded_len: Number of elements in encoded array
// Returns: true if save succeeded, false otherwise
bool SaveEncodedToFile(const char* filename, const uint16_t* encoded, uint32_t encoded_len) {
    FILE* file = fopen(filename, "w");
    if (!file) return false;
    
    // Write array header
    fprintf(file, "// RLE-Encoded RGB565 Data\n");
    fprintf(file, "const uint32_t rle_length = %lu;\n", encoded_len);
    fprintf(file, "const uint16_t rle_data[] = {\n");
    
    // Write data in 16-bit hex format
    for (uint32_t i = 0; i < encoded_len; i++) {
        if (i % 2 == 0) fprintf(file, "    "); // Indent every new pair
        fprintf(file, "0x%04X", encoded[i]);
        if (i != encoded_len - 1) fprintf(file, ", ");
        if (i % 2 == 1) fprintf(file, " // Run: %5u, Color: 0x%04X\n", encoded[i-1], encoded[i]);
    }
    
    // Close array
    if (encoded_len % 2 == 1) fprintf(file, "\n"); // Handle odd-length arrays
    fprintf(file, "};\n");
    fclose(file);
    return true;
}

// Load encoded data from file
// Parameters:
//   filename: Name of file to load
//   buffer: Pointer to buffer for loaded data
//   max_size: Maximum number of elements in buffer
//   loaded_len: Output parameter for number of elements loaded
// Returns: true if load succeeded, false otherwise
bool LoadEncodedFromFile(const char* filename, uint16_t* buffer, uint32_t max_size, uint32_t* loaded_len) {
    FILE* file = fopen(filename, "r");
    if (!file) return false;

    char line[256];
    uint32_t count = 0;
    bool in_array = false;

    while (fgets(line, sizeof(line), file)) {
        // Skip comments and empty lines
        if (line[0] == '/' || line[0] == '\n') continue;
        
        // Check for array start
        if (strstr(line, "rle_data[]")) {
            in_array = true;
            continue;
        }
        
        if (in_array) {
            char* ptr = line;
            while (*ptr && count < max_size) {
                // Look for hex values
                if (strncmp(ptr, "0x", 2) == 0) {
                    buffer[count++] = (uint16_t)strtoul(ptr, NULL, 16);
                    ptr += 6; // Skip past 0xXXXX format
                }
                else {
                    ptr++;
                }
            }
        }
        
        // Check for array end
        if (strstr(line, "};")) break;
    }

    fclose(file);
    *loaded_len = count;
    
    // Verify we loaded complete pairs
    if (count % 2 != 0) return false;
    return true;
}

// RLE Decoder for RGB565 format
// Parameters:
//   encoded: Pointer to encoded RLE data
//   encoded_len: Number of elements in encoded array
//   output: Pointer to output buffer for decoded RGB565 data
//   output_max_size: Maximum number of elements in output buffer
//   decoded_len: Output parameter for number of elements written to output buffer
// Returns: true if decoding succeeded, false otherwise
bool RLE_Decode_RGB565(const uint16_t* encoded, uint32_t encoded_len,
                      uint16_t* output, uint32_t output_max_size,
                      uint32_t* decoded_len) {
    // Encoded data must contain pairs of values
    if (encoded_len % 2 != 0) return false;

    uint32_t required_len = 0;

    // Calculate required output buffer size
    for (uint32_t i = 0; i < encoded_len; i += 2) {
        required_len += encoded[i];
        if (required_len > output_max_size) return false;
    }

    // Check if output buffer is large enough
    if (required_len > output_max_size) return false;

    *decoded_len = required_len;

    // Decode the RLE data
    uint32_t out_idx = 0;
    for (uint32_t i = 0; i < encoded_len; i += 2) {
        uint16_t count = encoded[i];
        uint16_t color = encoded[i + 1];

        // Fill output with 'count' copies of 'color'
        for (uint16_t j = 0; j < count; j++) {
            output[out_idx++] = color;
        }
    }

    return true;
}
